import { spacing, palette } from '@material-ui/system'
import Box from '@material-ui/core/Box'

const Dev = props => {

  function hello() {
    setTimeout(() => "hello", 1000)
  }

  return (
    <Box>
      <h1>{hello()}</h1>
    </Box>
  )
}

export default Dev
